g height=\"16\" width=\"16\" alt=\"🚩\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t65/2/16/1f6a9.png\" style=\"border: 0px; animation-name: none !important; transition-property: none !important;\"></span> Network / Server Knowledge</div><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important; margin-left: 25px;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit; animation-name: none !important; transition-property: none !important;\"><img height=\"16\" width=\"16\" alt=\"🚩\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t65/2/16/1f6a9.png\" style=\"border: 0px; animation-name: none !important; transition-property: none !important;\"></span> Database (MySql, MongoDB, …)</div><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important; margin-left: 25px;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit; animation-name: none !important; transition-property: none !important;\"><img height=\"16\" width=\"16\" alt=\"🚩\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t65/2/16/1f6a9.png\" style=\"border: 0px; animation-name: none !important; transition-property: none !important;\"></span> Domain Hosting Knowledge</div><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important;\"><br></div><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important;\"><br></div><h3 style=\"font-family: inherit; animation-name: none !important; transition-property: none !important;\">👨🏻‍💻 Full-stack Developer</h3><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important;\"><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; font-family: system-ui, -apple-system, system-ui, &quot;.SFNSText-Regular&quot;, sans-serif; animation-name: none !important; transition-property: none !important;\"><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important;\">Client ပိုင်းရော server ပိုင်းရော နှစ်ဘက်လုံး ပါဝင်ဖန်တီးနိုင်ရင်တော့ full-stack developer လိုသတ်မှတ်ကြပါတယ် full-stack develop လုပ်နိုင်ရင်တော့ အရမ်းကောင်းပါတယ် </div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; font-family: system-ui, -apple-system, system-ui, &quot;.SFNSText-Regular&quot;, sans-serif; animation-name: none !important; transition-property: none !important;\"><div dir=\"auto\" style=\"font-family: inherit; animation-name: none !important; transition-property: none !important;\"><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: inherit; animation-name: none !important; transition-property: none !important;\"><img height=\"16\" width=\"16\" alt=\"✅\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/2/16/2705.png\" style=\"border: 0px; animation-name: none !important; transition-property: none !important;\"></span> application တစ်ခုတည်ဆောက်တဲ့နေရာမှာ ဘက်ပေါင်းစုံကနေ ပါဝင်လုပ်ဆောင်နိုင်မယ်</div></div><div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\" style=\"overflow-wrap: break-word; margin: 0.5em 0px 0px; font-family: system-ui, -apple-system, system-ui, &quot;.SFNSText-Regular&quot;, sans-serif; animation-name: none !impor