 15px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><br></div><div dir=\"auto\" style=\"text-align: left; color: rgb(5, 5, 5); font-family: inherit; font-size: 15px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><span id=\"docs-internal-guid-f4b7f08f-7fff-c71e-64a2-b151bace8c14\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span style=\"border: none; display: inline-block; overflow: hidden; width: 451px; height: 122px; font-family: Arial;\"><br></span></span></span></div><div dir=\"auto\" style=\"text-align: left; color: rgb(5, 5, 5); font-family: inherit; font-size: 15px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><span id=\"docs-internal-guid-f4b7f08f-7fff-c71e-64a2-b151bace8c14\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:451px;height:122px;\"><span id=\"docs-internal-guid-73a5368a-7fff-c734-f953-5a258ce01b85\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span></span></span></span></span></div><div dir=\"auto\" style=\"text-align: center; color: rgb(5, 5, 5); font-family: inherit; font-size: 15px; white-space: pre-wrap; animation-name: none !important; transition-property: none !important;\"><span id=\"docs-internal-guid-f4b7f08f-7fff-c71e-64a2-b151bace8c14\"><span style=\"font-size: 12pt; font-family: &quot;Times New Roman&quot;; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span style=\"border:none;display:inline-block;overflow:hidden;width:451px;height:122px;\"><br></span></span></span><br></div></div>', '/storage/images/journals/1601630917.png', 'Sharing', 2, NULL, '2020-10-02 09:28:37', '2020-10-02 09:28:37'),

		array(13, '𝐃𝐞𝐬𝐢𝐠𝐧 𝐓𝐡𝐢𝐧𝐤𝐢𝐧𝐠 𝐏𝐫𝐨𝐜𝐞𝐬𝐬', '<p dir=\"ltr\" style=\"line-height:2.4;text-indent: 36pt;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">Application တခုစလုပ်ပြီဆိုရင် အကုန်လုံးနားလည်ဖို့ထက် အစိတ်အပိုင်း တခုချင်းစီ နားလည်ဖို့က ပိုအရေးကြီးပါတယ်။ App တခုလုံး create မလုပ်ခင် အပိုင်းပိုင်းလေးတွေ အရင်နားလည်အောင်လုပ်ပါ။&nbsp; ဘယ် product ပဲလုပ်လုပ် Design Thinking လိုအပ်ပါတယ်။ Design Thinking ဆိုတာ သုံးမယ့် user ကို အဓိကထားပြီး သူတို့ရဲ့ခက်ခဲနေတဲ့အပိုင်းကို ကိုယ့်ရဲ့ creatively idea ပေါင်းစပ်ပြီး ဖြေရှင်းပေးပါတာမျိုးဖြစ်ပါတယ်။&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">⁉️ ကိုယ့်ရဲ့ application က ဘယ်သူတွေအတွက် အဓိကထားတာလဲ?&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">⁉️ သုံးမယ့် သူတွေက ဘာတွေလိုအပ်နေတာလဲ?&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\">⁉️ သူတို့ ဘာ problem တွေဖြစ်နေတာလဲ? စတဲ့ user တွေရဲ့ လိုအပ်ချက်တွေကို မူတည်ပြီးတော့ စဥ်းစားတာဖြစ်ပါတယ်။ Design Thinking မှာ စဥ်းစားတဲ့ပုံစံ အမျိုးမျိုးအလုပ်လုပ်ပေမဲ့ ဒီ design thinking process 5 ချက်ကတော့ အတူတူပါပဲ။&nbsp;</span></p><p dir=\"ltr\" style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"text-align: center; line-height: 2.4; margin-top: 0pt; margin-bottom: 0pt;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"explainer.jpeg\" style=\"width: 100%;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 11pt; white-space: pre-wrap;\"><br></span></p><h2 style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(67, 67, 67); font-family: Arial; font-size: 14pt; white-space: pre-wrap;\"><br></span></h2><h2 style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(67, 67, 67); font-family: Arial; font-size: 14pt; white-space: pre-wrap;\">5 Stages in Design Thinking Process</span></h2><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">📌 Empathize</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">📌 Define</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">📌 Ideate</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">📌 Prototype</span></p><p dir=\"ltr\" style=\"line-height:2.4;margin-top:0pt;margin-bottom:0pt;\"><span id=\"docs-internal-guid-b0ac28ec-7fff-f26d-40ae-819e51aab54b\"></span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">📌 Test</span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.7999999999999998;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11pt;font-family:Arial;color:#000000;background-color:transparent;font-weight:400;font-style:normal;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span id=\"docs-internal-guid-b51c4c41-7fff-3735-0c30-862daa7fc764\"></span></span></p><h3 style=\"line-height:1.38;margin-top:14pt;margin-bottom:4pt;\"><span style=\"font-size:13pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:700;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\">1) Empathize</span></h3><h4 dir=\"ltr\" style=\"text-align: center; line-height: 1.38; margin-top: 14pt; margin-bottom: 4pt;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"1.jpg\" style=\"width: 100%;\"><span style=\"font-size:13pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:700;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><br></span></h4><h4 dir=\"ltr\" style=\"line-height:1.38;margin-top:14pt;margin-bottom:4pt;\"><span style=\"font-size:13pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:700;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-46a061b2-7fff-0ae9-3946-b767ba0a18cd\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Empathize ဆိုတာက developer/designer တွေက သုံးမဲ့ user တွေနေရာကနေပြီး ကိုယ့် application ကို ၀င်သုံးကြည့်တာမျိုး ဆိုလိုတာဖြစ်တယ်။ ကိုယ်ကို ဒီ application သုံးမယ့် user မျိုးဆို ဘယ်လိုသုံးမလဲ ၀င်ခံစားကြည့်တာမျိုးဖြစ်ပါတယ်။ ဒီ stage မှာဆိုရင် user တွေနဲ့ interview အမေးအဖြေ လုပ်ပြီး ပြဿနာတွေကို နားထောင်ရမယ်။ </span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">no-judgmental - </span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">သုံးမဲ့ user တွေကို ဒါလေးတောင် မသုံးမတတ်ဘူးလားဆိုတဲ့ ၀ေဖန် အကဲမဖြတ်ဖို့တော့လိုပါတယ်</span></span></span></h4><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">2) Define</span></h3><h4 dir=\"ltr\" style=\"text-align: center; line-height: 1.38; margin-top: 14pt; margin-bottom: 4pt;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"user-need-statements.jpg\" style=\"width: 100%;\"><span style=\"font-size:13pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:700;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-46a061b2-7fff-0ae9-3946-b767ba0a18cd\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><br></span></span></span></h4><h4 dir=\"ltr\" style=\"text-align: left; line-height: 1.38; margin-top: 14pt; margin-bottom: 4pt;\"><span style=\"font-size:13pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:700;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-46a061b2-7fff-0ae9-3946-b767ba0a18cd\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span id=\"docs-internal-guid-6bbba69a-7fff-c179-3ec9-15c4c108f1fc\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">&nbsp;</span><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">ဒီ stage ကတော့ တနည်းအားဖြင့် User Need Statements (or) Problem Statements (or) Point-of-view statements လို့ ခေါ်ပါတယ်။ Developer / Design တွေက ဘယ်အပိုင်းကတော့ User တွေအတွက် Highlight ဖြစ်စေတဲ့ အရာတွေကို analyze လုပ်မဲ့ အပိုင်းဖြစ်ပါတယ်။ ဥပမာ - user က dropdown နဲ့ မရွေးချင်တာကို ကိုယ်က radio button အစားထိုးပြောင်းလဲပေးလိုက်ခြင်းဖြင့် သူတို့အတွက် easy-to-use ဖြစ်သွားတာမျိုးကိုလဲ problem solving လို့ ပြောလို့ရပါတယ်။ ဒါကြောင့် user တွေကို ဘယ်အပိုင်းကတော့ အရေးကြီးတယ်.. ဘယ်နေမှာတော့ user ကို easy-to-use ဖြစ်အောင်လုပ်မလဲ… user တွေမှာလဲ point-of-view အမျိုးမျိုး ရှိတဲ့အတွက် user တွေကို နားလည်ပေးရမယ်&nbsp; စတဲ့ အချက်တွေကို developer / designer ကို research လုပ်ပြီး လုပ်ဆောင် ကြတာဖြစ်ပါတယ်။</span></span></span></span></span></h4><h4 dir=\"ltr\" style=\"text-align: left; line-height: 1.38; margin-top: 14pt; margin-bottom: 4pt;\"><span style=\"font-size:13pt;font-family:Arial;color:#666666;background-color:transparent;font-weight:700;font-style:italic;font-variant:normal;text-decoration:none;vertical-align:baseline;white-space:pre;white-space:pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-46a061b2-7fff-0ae9-3946-b767ba0a18cd\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span id=\"docs-internal-guid-6bbba69a-7fff-c179-3ec9-15c4c108f1fc\"><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"></span></span></span></span></span></h4><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">3) Ideate</span></h3><h3 style=\"text-align: center; margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"image-SQUARE.jpg\" style=\"width: 100%;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></h3><h3 style=\"text-align: left; margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-40ecff8c-7fff-cc7e-3098-eb044729b850\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Ideate အပိုင်းမှာကတော့ user တွေအနေနဲ့ ဘယ်ဟာကတော့ ကောင်းတယ် ဘယ်ဟာလေးမှာတော့ မကောင်းဘူး စတဲ့ decision တွေထွက်လာမယ်။ အဲ့ဒီမှာ idea တွေကို ဘယ်လို brainstorming&nbsp; လုပ်မလဲ။ idea ထုတ်တဲ့အချိန်မှာ negative အတွေးတွေကို ထုတ်ပစ်လိုက်ပါ။ အဆိုးမြင်နေသရွေ့ idea က ကောင်းကောင်းမထွက်နိုင်ပါဘူး။ အဓိက main point တွေ မပါမဖြစ် ဦးစားပေးစဥ်းစားရပါမယ်။ main point အပြင် user တွေကို easy-to-use ဖြစ်စေမဲ့ပုံစံမျိုး ဦးတည်ပြီး ရှာဖွေမယ်။ idea အများကြီးထက် ကျစ်ကျစ်လစ်လစ်နဲ့ user တွေရဲ့ ပြဿနာကို ဖြေရှင်းပေးနိုင်တဲ့ idea တခုထဲနဲ့ good product ဖြစ်လာနိုင်ပါတယ်။</span></span></span></h3><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">4) Prototype</span></h3><h3 style=\"text-align: center; margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"4ae7ba8ccad5276ec7ac4e51d29c9fc5.jpg\" style=\"width: 100%;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></h3><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-9ef5d441-7fff-6b32-d0f8-b5016e30341c\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Application တွေ create လုပ်တာမှာ idea ပေါ်အခြေခံပြီး&nbsp; Wireframe တွေ sketch တွေနဲ့ အရင် အကြမ်းဆွဲကြည့်မယ်။ အရေးကြီးတဲ့ အရာတွေကို ဘယ်နေရာတွေမှာ မြင်အောင်ပြမလဲ ဆိုတာတွေ စဥ်းစားရမယ်။ </span></span></span></h3><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">4) Test</span></h3><h3 style=\"text-align: center; margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"57367.jpg\" style=\"width: 100%;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span></h3><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-aa693ca3-7fff-db4e-3e03-23751f7291e3\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"><span class=\"Apple-tab-span\" style=\"white-space:pre;\">	</span></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\">Sketch ဆွဲပြီးရင် testing လုပ်ရပါမယ်။ user တွေစီက feedback ယူမယ်။ ဘယ်အပိုင်းကတော့ user တွေစီမှာ အဆင်မပြေတာမျိုးရှိရင် re-design ပြန်လုပ်ရပါမယ်။ ဒီ stage ကတော့ prototype ကို test လုပ်တဲ့ အဆင့်ပါ။ သုံးမဲ့ user က အဆင်မပြေဖြစ်ခဲ့ရင် re-design လုပ်ရတာလွယ်ပါတယ်။ application ကို launch လုပ်ခံနီးမှ အဆင်မပြေခဲ့ရင် re-develop လုပ်ရတာ ခက်ခဲနိုင်ပါတယ်။ ဒါကြောင့် Developer တွေစီ မရောက်ခင် ကိုယ့်ရဲ့ Design&nbsp; ကို User နဲ့ အဆင်ပြေဖို့ လိုအပ်တဲ့ အဆင့်ဆင့်ကို&nbsp; testing စစ်ထားဖို့လိုပါတယ်။ </span></span><br></span></h3><h3 style=\"margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-9ef5d441-7fff-6b32-d0f8-b5016e30341c\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;\"></span></span><br></span></h3><h3 style=\"text-align: left; margin-top: 14pt; margin-bottom: 4pt; line-height: 1.38;\"><span style=\"font-family: Arial; font-size: 13pt; color: rgb(102, 102, 102); background-color: transparent; font-weight: 700; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-weight:normal;\" id=\"docs-internal-guid-40ecff8c-7fff-cc7e-3098-eb044729b850\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-style: normal; font-